import react, { useContext } from "react";
import { Link } from "react-router-dom";
import { FooContext } from "../App";

const Products = () => {
	const value = useContext(FooContext);
	return <section>
		<h1>The Products Page {value}</h1>	
		<ul>
			<li><Link to={"/products/p1"}>Book {value.type}</Link></li>
			<li><Link to={"/products/p2"}>Carpet {value.color}</Link></li>
			<li><Link to={"/products/p3"}>Online Course {value.material}</Link></li>			
		</ul>
	</section>
};

export default Products;
